import React from "react";
import './App.css';

function Neo({name, danger}) {
  const danger_str = ({danger} ? "Yes" : 'No');
  return(
    <div className="Neo">
      <h1> {name} </h1>
      <p> danger_str </p>
      <img src="" alt="" />
    </div>
  );
}

export default Neo;
